rg/community/index.php?topic=149553.0\',\n		time: \'Sunday 11 February 2007 - 08:35\',\n		author: \'Grudge\',\n		message: \'A patch has been released to address a number of outstanding bugs in SMF 1.1.1, including several around UTF-8 language support. In addition this patch offers improved image verification support and fixes a couple of low risk security related bugs. If you need any help upgrading please visit our forum.\'\n	},\n	{\n		subject: \'SMF 1.1.1\',\n		href: \'http://www.simplemachines.org/community/index.php?topic=134971.0\',\n		time: \'Sunday 17 December 2006 - 09:33\',\n		author: \'Grudge\',\n		message: \'A number of small bugs and a potential security issue have been discovered in SMF 1.1. We urge all forum administrators to upgrade to SMF 1.1.1 - simply visit the package manager to install the patch.\'\n	},\n	{\n		subject: \'SMF 1.1\',\n		href: \'http://www.simplemachines.org/community/index.php?topic=131008.0\',\n		time: \'Saturday 02 December 2006 - 14:53\',\n		author: \'Grudge\',\n		message: \'SMF 1.1 has gone gold!  If you are using an older version, please upgrade as soon as possible - many things have been changed and fixed, and mods and packages will expect you to be using 1.1.  If you need any help upgrading custom modifications to the new version, please feel free to ask us at our forum.\'\n	},\n	{\n		subject: \'SMF 1.0.9 and patch for SMF 1.1 RC3\',\n		href: \'http://www.simplemachines.org/community/index.php?topic=123285.0\',\n		time: \'Sunday 29 October 2006 - 05:57\',\n		author: \'Compuart\',\n		message: \'A security issue has been discovered in both SMF 1.0 and SMF 1.1. Therefore a patch has been released that will upgrade SMF 1.0.8 to 1.0.9 and update SMF 1.1 RC3. You are encouraged to update immediately, using the package manager or otherwise.\'\n	},\n	{\n		subject: \'SMF 1.1 RC3\',\n		href: \'http://www.simplemachines.org/community/index.php?topic=107112.0\',\n		time: \'Monday 21 August 2006 - 19:32\',\n		author: \'Grudge\',\n		message: \'Release Candidate 3 of SMF 1.1 has been released! This is the final update to SMF 1.1 before it goes final - and includes UTF support as well as numerous bug fixes. Please read the announcement for details - and only upgrade if you are comfortable running software yet to go gold.\'\n	},\n	{\n		subject: \'SMF 1.0.8\',\n		href: \'http://www.simplemachines.org/community/index.php?topic=107135.0\',\n		time: \'Monday 21 August 2006 - 19:32\',\n		author: \'Compuart\',\n		message: \'A security issue has been reported in PHP causing a vulnerability in SMF. A patch has been released to upgrade Simple Machines Forum from 1.0.7 to 1.0.8. You are encouraged to update immediately, using the package manager or otherwise.\'\n	},\n	{\n		subject: \'SMF 1.0.7 and patch for SMF 1.1 RC2\',\n		href: \'http://www.simplemachines.org/community/index.php?topic=78841.0\',\n		time: \'Wednesday 29 March 2006 - 17:32\',\n		author: \'Compuart\',\n		message: \'A security issue has been discovered in both SMF 1.0 and SMF 1.1. Therefor a patch has been released that will upgrade SMF 1.0.6 to 1.0.7 and update SMF 1.1 RC2. You are encouraged to update immediately, using the package manager or otherwise.\'\n	},\n	{\n		subject: \'SMF 1.0.6\',\n		href: \'http://www.simplemachines.org/community/index.php?topic=68110.0\',\n		time: \'Saturday 28 January 2006 - 06:36\',\n		author: \'Grudge\',\n		message: \'SMF 1.0.6 has been released.  This release addresses a potential security issue as well as a few minor bugs found since the 1.0.5 release. You are encouraged to update immediately, using the package manager or otherwise. This update does not apply to the 1.1 line!\'\n	},\n	{\n		subject: \'Bug in Firefox 1.5\',\n		href: \'http://www.simplemachines.org/community/index.php?topic=66862.0\',\n		time: \'Tuesday 24 January 2006 - 08:09\',\n		author: \'Grudge\',\n		message: \'There is a bug in Firefox 1.5 which can cause server issues for forums running SMF 1.1 (RC1/RC2). There is a simple fix which can be downloaded from the Simple Machines forum.\'\n	},\n	{\n		subject: \'SMF 1.1 RC2\',\n		href: \'http://www.simplemachines.org/community/index.php?topic=62731.0\',\n		time: \'Saturday 31 December 2005 - 14:58\',\n		author: \'Grudge\',\n		message: \'The second (and final) Release Candidate of SMF 1.1 has been released! Please read the announcement for details - and please update only if you are certain you are comfortable with software that hasn\\\'t gone gold yet. There is no package manager style update for this version.\'\n	}\n];\nif (window.smfVersion < \"SMF 1.1\")\n{\n	window.smfUpdateNotice = \'SMF 1.1 Final has now been released. To take advantage of the improvements available in SMF 1.1 we recommend upgrading as soon as is practical.\';\n	window.smfUpdateCritical = false;\n}\n\nif (document.getElementById(\"yourVersion\"))\n{\n	var yourVersion = getInnerHTML(document.getElementById(\"yourVersion\"));\n	if (yourVersion == \"SMF 1.0.4\")\n		window.smfUpdatePackage = \"http://custom.simplemachines.org/mods/downloads/smf_1-0-5_package.tar.gz\";\n	else if (yourVersion == \"SMF 1.0.5\" || yourVersion == \"SMF 1.0.6\")\n	{\n		window.smfUpdatePackage = \"http://custom.simplemachines.org/mods/downloads/smf_patch_1.0.7_1.1-RC2-1.tar.gz\";\n		window.smfUpdateCritical = false;\n	}\n	else if (yourVersion == \"SMF 1.0.7\")\n		window.smfUpdatePackage = \"http://custom.simplemachines.org/mods/downloads/smf_1-0-8_package.tar.gz\";\n	else if (yourVersion == \"SMF 1.0.8\")\n		window.smfUpdatePackage = \"http://custom.simplemachines.org/mods/downloads/smf_patch_1-0-9_1-1-rc3-1.tar.gz\";\n	else if (yourVersion == \"SMF 1.0.9\")\n		window.smfUpdatePackage = \"http://custom.simplemachines.org/mods/downloads/smf_1-0-10_patch.tar.gz\";\n	else if (yourVersion == \"SMF 1.0.10\" || yourVersion == \"SMF 1.1.2\")\n		window.smfUpdatePackage = \"http://custom.simplemachines.org/mods/downloads/smf_patch_1.1.3_1.0.11.tar.gz\";\n	else if (yourVersion == \"SMF 1.0.11\" || yourVersion == \"SMF 1.