INSERT INTO `smf_messages` VALUES (5,5,1,1439644923,2,6,'Charte','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1439645728,'Alexandra','','Introduction:<br><br>Ce forum se veut tre un espace de discussions et d\'changes entre passionns. Pour que chacun puisse passer un moment en toute convivialit, voici quelques rgles de bonne conduite  observer<br><br>1- Objet du forum:<br><br>Ce forum regroupe les membres de Sublime-Voyance. Les thmes abords porteront essentiellement sur la parapsychologie sous toutes ses formes. Ce forum a donc pour objectif de faciliter la communication et le partage d\'information.<br><br>2- Modalits d\'accs au forum:<br>Pour prendre connaissance des messages posts sur notre forum, une inscription est obligatoire<br>En effet, la majeure partie des sujets de ce forum peut tre lue par tous. En revanche, quelques rubriques sont protges et seuls les membres adhrents au Staff peuvent poster des messages.<br><br>3- Les rgles du forum:<br><br>- Politesse et savoir-vivre: respectez les membres, utilisez des formules de politesse, restez calme.<br>- Tous propos diffamatoires, injurieux, insultants, racistes, xnophobes ou obscnes sont interdits sur le forum.<br>- N\'abusez pas de l\'criture en majuscules. En effet, ces dernires symbolisent un internaute qui CRIE.<br>- [color=red][b]Pour une lecture agrable de ce forum, nous vous incitons  soigner votre orthographe, votre syntaxe et  ne pas utiliser le langage sms.[/b][/color] Nous vous en remercions par avance.<br><br>4- Le rle du modrateur:<br><br>Le rle du modrateur est de faire respecter les rgles de bonne conduite pour rendre les espaces de discussions conviviaux et agrables  tous, en adquation avec les lois du pays (dfinis par le cadre juridique du pays).<br><br>Les missions du modrateur sont : <br><br>- Supprimer des messages ou des discussions ne respectant pas les rgles de bonne conduite.<br>- Supprimer les profils qui nuisent au bon fonctionnement du forum, par exemple via des messages insultants, des messages provocateurs, du proslytisme religieux ou politique, racistes, xnophobes, etc. <br>- Sont concerns galement les utilisateurs qui utilisent simultanment plusieurs profils diffrents sur le mme forum : c\'est une attitude que nous assimilons  de la malhonntet envers les autres utilisateurs et donc non admise sur notre forum.<br>- Rpondre  vos alertes ou demandes particulires.<br>- Effacer tout propos interdit sur le site tel que par exemple des propos racistes, diffamatoires, insultants, xnophobes, pdophiles... Que ces propos soient explicites ou implicites, ils seront supprims.<br>- Retirer tout contenu texte, post, photo ou vido illicites<br><br>Le modrateur intervient a posteriori et nintervient pas dans les discussions pour donner son avis, ni lors dun conflit pour donner raison a un internaute. Si un message vous semble contraire aux rgles de bonne conduite nonces ici, signalez-le au modrateur en cliquant sur le bouton &quot;Modrateur&quot; qui figure en bas de page du forum. Vous pourrez lui envoyer un MP .<br><br>Bien  Vous<br><br>Alexandra: Administrateur','xx',1,0),(6,6,5,1439645485,2,81,'Conditions gnrales','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1441059666,'Alexandra','','Informations lgales<br><br>1. Prsentation du site.<br>En vertu de larticle 6 de la loi n 2004-575 du 21 juin 2004 pour la confiance dans lconomie numrique, il est prcis aux utilisateurs du site la.cote-des-annonces.com lidentit des diffrents intervenants dans le cadre de sa ralisation et de son suivi :<br><br>Propritaire : Cote Lionel  Bureau dtude  16 rue Casimir Fournier Maubeuge 59600<br><br>Crateur : Cote Lionel<br><br>Responsable publication : Lionel Cote  dg@cote7.com<br><br>Le responsable publication est une personne physique ou une personne morale.<br><br>Webmaster : Cote Lionel  dg@cote7.com<br><br>Tlphone : 0783592721<br><br>Hbergeur : Cote7  16 rue Casimir Fournier 59600 Maubeuge<br><br>2. Conditions gnrales dutilisation du site et des services proposs.<br>Lutilisation du uuu.sublime-voyance.be implique lacceptation pleine et entire des conditions gnrales dutilisation ci-aprs dcrites. Ces conditions dutilisation sont susceptibles dtre modifies ou compltes  tout moment, les utilisateurs du uuu.sublime-voyance.be sont donc invits  les consulter de manire rgulire.<br><br>Ce site est normalement accessible  tout moment aux utilisateurs. Une interruption pour raison de maintenance technique peut tre toutefois dcide par Cote Lionel, qui sefforcera alors de communiquer pralablement aux utilisateurs les dates et heures de lintervention.<br><br>Le uuu.sublime-voyance.be est mis  jour rgulirement par Lionel Cote. De la mme faon, les mentions lgales peuvent tre modifies  tout moment : elles simposent nanmoins  lutilisateur qui est invit  sy rfrer le plus souvent possible afin den prendre connaissance.<br><br>3. Description des services fournis.<br>Le uuu.sublime-voyance.be a pour objet de fournir une information concernant lensemble des activits de la socit.<br><br>Cote Lionel sefforce de fournir sur le uuu.sublime-voyance.be des informations aussi prcises que possible. Toutefois, il ne pourra tre tenue responsable des omissions, des inexactitudes et des carences dans la mise  jour, quelles soient de son fait ou du fait des tiers partenaires qui lui fournissent ces informations.<br><br>Tous les informations indiques sur le uuu.sublime-voyance.be donnes  titre indicatif, et sont susceptibles dvoluer. Par ailleurs, les renseignements figurant sur le uuu.sublime-voyance.be ne sont pas exhaustifs. Ils sont donns sous rserve de modifications ayant t apportes depuis leur mise en ligne.<br><br>4. Limitations contractuelles sur les donnes techniques.<br>Le site utilise la technologie JavaScript.<br><br>Le site Internet ne pourra tre tenu responsable de dommages matriels lis  lutilisation du site. De plus, lutilisateur du site sengage  accder au site en utilisant un matriel rcent, ne contenant pas de virus et avec