personnelles.<br>En France, les donnes personnelles sont notamment protges par la loi n 78-87 du 6 janvier 1978, la loi n 2004-801 du 6 aot 2004, larticle L. 226-13 du Code pnal et la Directive Europenne du 24 octobre 1995.<br><br>A loccasion de lutilisation du uuu.sublime-voyance.be, peuvent tres recueillies : lURL des liens par lintermdiaire desquels lutilisateur a accd au uuu.sublime-voyance.be, le fournisseur daccs de lutilisateur, ladresse de protocole Internet (IP) de lutilisateur.<br><br>En tout tat de cause Cote Lionel ne collecte des informations personnelles relatives  lutilisateur que pour le besoin de certains services proposs par le uuu.sublime-voyance.be. Lutilisateur fournit ces informations en toute connaissance de cause, notamment lorsquil procde par lui-mme  leur saisie. Il est alors prcis  lutilisateur du uuu.sublime-voyance.be lobligation ou non de fournir ces informations.<br><br>Conformment aux dispositions des articles 38 et suivants de la loi 78-17 du 6 janvier 1978 relative  linformatique, aux fichiers et aux liberts, tout utilisateur dispose dun droit daccs, de rectification et dopposition aux donnes personnelles le concernant, en effectuant sa demande crite et signe, accompagne dune copie du titre didentit avec signature du titulaire de la pice, en prcisant ladresse  laquelle la rponse doit tre envoye.<br><br>Aucune information personnelle de lutilisateur du site la.cote-des-annonces.com nest publie  linsu de lutilisateur, change, transfre, cde ou vendue sur un support quelconque  des tiers. Seule lhypothse du rachat de Cote Lionel et de ses droits permettrait la transmission des dites informations  lventuel acqureur qui serait  son tour tenu de la mme obligation de conservation et de modification des donnes vis  vis de lutilisateur du uuu.sublime-voyance.be.<br><br>Le site susnomm est dclar  la CNIL sous le numro 822471 07/10/2002.<br><br>Les bases de donnes sont protges par les dispositions de la loi du 1er juillet 1998 transposant la directive 96/9 du 11 mars 1996 relative  la protection juridique des bases de donnes.<br><br>8. Liens hypertextes et cookies.<br>Le uuu.sublime-voyance.be contient un certain nombre de liens hypertextes vers dautres sites, mis en place avec lautorisation de Cote Lionel. Cependant, Cote Lionel na pas la possibilit de vrifier le contenu des sites ainsi visits, et nassumera en consquence aucune responsabilit de ce fait.<br><br>La navigation sur le uuu.sublime-voyance.be est susceptible de provoquer linstallation de cookie(s) sur lordinateur de lutilisateur. Un cookie est un fichier de petite taille, qui ne permet pas lidentification de lutilisateur, mais qui enregistre des informations relatives  la navigation dun ordinateur sur un site. Les donnes ainsi obtenues visent  faciliter la navigation ultrieure sur le site, et ont galement vocation  permettre diverses mesures de frquentation.<br><br>Le refus dinstallation dun cookie peut entraner limpossibilit daccder  certains services. Lutilisateur peut toutefois configurer son ordinateur de la manire suivante, pour refuser linstallation des cookies :<br><br>Sous Internet Explorer : onglet outil (pictogramme en forme de rouage en haut a droite) / options internet. Cliquez sur Confidentialit et choisissez Bloquer tous les cookies. Validez sur Ok.<br><br><br>9. Droit applicable et attribution de juridiction.<br>Tout litige en relation avec lutilisation du uuu.sublime-voyance.be est soumis au droit franais. Il est fait attribution exclusive de juridiction aux tribunaux comptents de Paris.<br><br>10. Les principales lois concernes.<br>Loi n 78-87 du 6 janvier 1978, notamment modifie par la loi n 2004-801 du 6 aot 2004 relative  linformatique, aux fichiers et aux liberts.<br><br>Loi n 2004-575 du 21 juin 2004 pour la confiance dans lconomie numrique.<br><br>11. Lexique.<br>Utilisateur : Internaute se connectant, utilisant le site susnomm.<br><br>Informations personnelles :  les informations qui permettent, sous quelque forme que ce soit, directement ou non, lidentification des personnes physiques auxquelles elles sappliquent  (article 4 de la loi n 78-17 du 6 janvier 1978).<br><br>Crdits : les mentions lgales ont t gnres et offertes par Subdelirium agence web Angoulme','xx',1,0),(7,7,6,1439648865,2,7,'Mthode de cartomancie par Mary Marco et Jeanine Goffinet ','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Si pendant des sicles, l\'instruction a t rserve  une lite et tenue hors de porte de tout un chacun, il n\'en est plus de mme maintenant.<br><br>La somme des connaissances exotriques acquises par l\'homme depuis son apparition sur la terre s\'enseigne maintenant  tous, de faon normative, trop parfois, et constitue le bagage culturel de chacun de nous.<br><br>C\'est ainsi que pendant des sicles, le &quot;savoir&quot; s\'est prserv de l\'oppression du rationalisme et du scientisme qui sont en grande partie le fait de notre civilisation occidentale.<br>Au moment o enfin l\'homme commence  reconnatre qu\'il n\'est pas que matire, technique, mais aussi esprit, ce &quot;savoir&quot; peut sortir de l\'ombre et accder  la lumire, lui qui tait notre Lumire.<br><br>Les facults de l\'esprit, encore si peu connues et si mal employes sont infinies.<br><br>Libr des contraintes de nos sens imparfaits et des limites troites de nos normes spatio-temporelles, l\'esprit accde  la connaissance universelle&quot;.<br><br>Toute tude se base sur l\'apprentissage et l\'exercice; nous tous encore en mmoire. anciens coliers, les longues soires consacres  l\'tude et  la rptition, dans la seule compagnie des manuels scolaires, et le souvenir des matres d\'cole qui nous transmettaient leur savoir.<br><br>La connaissance sotrique aussi, se transmet et s\'apprend de la mme faon; par l\'enseignement du matre et par l\'tude des livres qui runissent la somme des connaissances.<br><br>Il m \'a t donn au cours de ma carrire d\'enseignant, d\'user nombre de manuels scolaires.<br>Les meilleurs taient ceux qui, outre une base solide et accessible  tous, renforaient la thorie par de nombreux exercices attractifs et un langage non-rebutant.<br><br>Le prsent livre rpond  ces critres.<br><br>Mthode de cartomancie par Mary Marco et Jeanine Goffinet <br><br>Il est n de la rencontre de trois femmes.<br><br>(Depuis les temps immmoriaux, la femme a souvent t dpositaire du savoir sotrique face  l\'homme aveugl par le patriarcat et le culte de la raison).<br><br>La premire, Marie-Anne Adlade Lenormand, a t de son temps u ne devineresse clbre dont la justesse de prvision a tonn plus d\'un.<br><br>La seconde, Mary Marco, est un de ces tres qui ont la grce de dpasser notre espace-temps; elle met ses facults au service des autres, et convaincue que chacun les a, transmet ses connaissances et encourage le dveloppement du Psi.<br><br>La troisime, Jeanine Goffinet, initialement enseignante, a, depuis sa rencontre avec Mary Marco, progressivement abandonn l\'enseignement traditionnel au profit de la Tradition.<br><br>La connivence, la similitude d \'esprit, de pense et de cur et le dsir commun de ces dames de transmettre un savoir sont  prsent entre vos mains.<br><br>Puissent-elles rpondre  votre attente, vous aider  dpasser vos limites et vous ouvrir la &quot;voie royale de la connaissance&quot;.<br><br>J. Mercier<br>Inspecteur pdagogique Recteur de l \'INSPA<br>Administrateur gnral de 1\'APEL.<br>11','xx',1,0),(8,8,6,1439652735,2,8,'Explication du forum','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Ce forum a t cr pour toute personne enregistre utilisant le petit Lenormand et ayant envie de partager ses connaissances, les significations des cartes, les diffrentes combinaisons de jeux.<br><br>Le tout dans la bonne humeur et le respect de chacun<br><br>Allez-y, amusez-vous.','xx',1,0),(9,9,26,1439653476,2,9,'Le petit Lenormand','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Petit Lenormand, Mthode De Cartomancie par Mary Marco et Jeanine Goffinet.<br><br>Un livre intressant pour les dbutants pour commencer petit  petit  comprendre les cartes<br><br>Editions Servranx Bruxelles. <br><br>ISBN 2-87242-030-4<br>','xx',1,0),(10,10,2,1439654054,2,10,'Introduction  la parapsychologie','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','La parapsychologie est ltude rationnelle, approfondie, et pluridisciplinaire des faits semblant inexplicables en ltat actuel de nos connaissances scientifiques, et mettant en jeu le psychisme et son interaction avec lenvironnement.','xx',1,0),(11,11,3,1439654189,2,11,'Le jeu de tarot','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Jeu de 78 cartes (appeles lames), servant au jeu ou  la divination. Jeu qu\'on joue avec ces cartes.','xx',1,0),(12,12,13,1439655132,2,13,'Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1439655448,'Alexandra','','Nous seuls dcidons consciemment d\'tre heureux,<br>C\'est un choix, je choisis le bonheur.<br>','xx',1,0),(13,12,13,1439655219,2,13,'Re: Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1439655458,'Alexandra','','Je sais qu\'il n\'y a pas de chemin vers le bonheur,<br>Le bonheur est le chemin.','xx',1,0),(14,12,13,1439655517,2,14,'Re: Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','tre heureux est une dcision que nous pouvons tous prendre un jour dans notre vie,<br>Je dcide d\'tre heureux.<br>','xx',1,0),(15,12,13,1439655539,2,15,'Re: Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','L\'obstacle majeur  l\'atteinte du bonheur est bien souvent la conviction qu\'on ne le mrite pas.<br>Je mrite le bonheur, j\'en suis convaincu.<br>','xx',1,0),(16,12,13,1439655551,2,16,'Re: Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je baigne dans l\'abondance la plus totale.','xx',1,0),(17,12,13,1439655561,2,17,'Re: Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je suis une personne extraordinaire,<br>Je m\'apprcie telle que je suis.<br>','xx',1,0),(18,12,13,1439655574,2,18,'Re: Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je sais que j\'ai plus de pouvoir sur ma vie que ce que je crois.','xx',1,0),(19,13,10,1439656707,2,19,'Esotrique','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Ce terme, dont le sens diffre de faon notable selon les poques et les auteurs, est parfois utilis dans la culture populaire pour parler de courants de pense marginaux  composante secrte ou trange (socits secrtes, occultisme, paranormal, etc.)','xx',1,0),(20,14,4,1439657091,2,20,'Clairvoyance','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Facult de voir avec clart, sagacit, pntration, lucidit.<br>Analyser une situation avec clairvoyance.<br>Forme de perception extrasensorielle d\'objets ou d\'vnements.','xx',1,0),(21,15,3,1439657659,2,21,'Les secrets de la tarologie','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Le tarot divinatoire est l\'application de la cartomancie aux cartes du tarot de Marseille ou de ses variantes historiques ou modernes. C\'est un art divinatoire qui utilise toutes ou une partie des 78 cartes du tarot de Marseille. Suivant le contexte d\'utilisation  oracle ou approche plus psychologique  cette pratique d\'interprtation des cartes est diversement dsigne par diffrents nologismes, par exemple tarologie.','xx',1,0),(22,16,7,1439657781,2,22,'Pendule ou tout autre objet','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','La radiesthsie est un procd de dtection fond sur la sensibilit des tres vivants  certaines radiations qu\'mettraient diffrents corps. Elle permettrait de localiser des sources, retrouver un objet perdu, un trsor ou une personne disparue, tablir un diagnostic mdical, dterminer la profondeur d\'un puits, etc.','xx',1,0),(23,16,7,1439657863,2,23,'Re: Pendule