om the calendar, video links (included in posts), and recent picture from SMF Gallery (if installed) - the newsletter email always includes an unsubscribe link.<br><br>Features:<br>[list]<br>[li]Newsletter can be subscribed to during initial forum registration or at any time[/li]<br>[li]Newsletter frequency can be selected by the user when subscribing (weekly, fortnightly or monthly)[/li]<br>[li]Frequency timer starts from when the user subscribes (to reduce server email load).[/li]<br>[li]Subscriber can unsubscribe on the forum OR by clicking an &quot;unsubscribe&quot; link in the Newsletter.[/li]<br>[li]Newsletter sub/unsubscribe options show above OR below forum list.[/li]<br>[li]Newsletter is HTML formatted (includes plain text version) using forum name and logo image (styling can be edited).[/li]<br>[li]Portal PHP block code included (to allow newletter subscription options to appear on any portal page (using a custom portal PHP block)[/li]<br>[/list]<br><br>Admin Settings:<br>[list]<br>[li]Allow guest to subscribe to the newsletter.[/li]<br>[li]Use guest permissions when selecting topics, videos and pictures to include.[/li]<br>[li]Choose position of Subscribe/Unsubscribe buttons (top or bottom of forum listing)[/li]<br>[li]Chose whether subscribtion option is shown during forum registration[/li]<br>[li]Number of recent topic titles/links to include in the newsletter (set to 0 to exclude topics from the newsletter)[/li]<br>[li]Select which boards to exclude when selecting topics[/li]<br>[li]Number of recent videos to include (set to 0 to exclude videos from the newsletter)[/li]<br>[li]Select which boards to exclude videos from[/li]<br>[li]Include SMF Gallery pictures[/li]<br>[li]Gallery categories to ignore[/li]<br>[li]Include basic forum stats[/li]<br>[li]Include the latest news item (the SMF newsfader doesn\'t have to be enabled)[/li]<br>[li]Include basic forum stats[/li]<br>[li]Include calendar events[/li]<br>[li]Manual subscribtion removal by email address - allows deletion of invalid or bouncing emails[/li]<br>[li]Newletter CSS styling can be edited in the SMF Language Editor[/li]<br>[li]Newletter can be previewed before activating.[/li]<br>[/list]<br><br>Note that unless you have selected guest permissions or exclude some board(s) then the titles of (and links to) new topics that appear in ALL boards will be included in the newsletter even if the recipient does not have permission to read the topic post itself. &nbsp;This can be used as a way to encourage forum or group membership by showing topic titles but not allowing access to the content.<br><br>To change the CSS styling of the newsletter:<br>[i]Admin-&gt;Configuration-&gt;Languages-&gt;Edit Languages-&gt;(whatever your langueg is called)-&gt;edit Languages Entries -&gt; select &quot;Modifications&quot;[/i]<br>... find and edit the CSS string &quot;newsltr_email_style&quot;<br><br><br>Requirements:<br>PHP version 5.2 or higher<br>SMF version 2.0 or higher<br><br>[b]Note[/b]:&nbsp;<br>On some web hosts you may need to disable compression in SMF (if the newletter preview shows a blank page):<br>Admin-&gt;Configuration-&gt;Server Settings-&gt;General and clear enable compressed output option<br><br>[b]Adding Newsletter Subscription to a Portal page[/b]<br>You can add the newsletter subscription options on any portal page (if it supports custom PHP code blocks - EzPortal, SimplePortal, etc.) &nbsp;After installing this mod, create a new custom PHP block in your portal (see portal instaructions) and paste the code from the file [b]portal_block.php[/b], included in this zip package into the new block.<br><br>[i]Updates:[/i]<br>[size=8pt]v1.25<br>added subscribe on register feature<br>v1.23<br>fixed portal_block.php syntax error<br>added more robust check for SMF Gallery<br>v1.22<br>fixed bug in video inclusion code (shows in error log)<br>added sample portal PHP block code<br>v1.21<br>fixed SMF_Gallery detection bug in adminsettings&nbsp;<br>v1.20<br>Cleaned up HTML format imporving email client compatibility<br>Newsletter can include SMF Gallery pictures and YouTube videos (from posts)<br>v1.14<br>Now works properly on forums with unsupported languages (reverts to english)<br>v1.13<br>moved newsletter CSS style to languages - can now be edited by an admin<br>....<br>[/size]<br><br>License:<br>Copyright 2012/2013 John Robertson<br>Released under the GNU/GPL license<br><br>&nbsp; &nbsp; This is free software: you can redistribute it and/or modify<br>&nbsp; &nbsp; it under the terms of the GNU General Public License as published by<br>&nbsp; &nbsp; the Free Software Foundation, either version 3 of the License, or<br>&nbsp; &nbsp; (at your option) any later version.<br><br>&nbsp; &nbsp; This software is distributed in the hope that it will be useful,<br>&nbsp; &nbsp; but WITHOUT ANY WARRANTY; without even the implied warranty of<br>&nbsp; &nbsp; MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE. &nbsp;See the<br>&nbsp; &nbsp; GNU General Public License for more details.<br>','xx',1,0),(35,12,13,1439851880,2,35,'Re: Phrase positive','Alexandra','alexandra7voyante@gmail.com','91.178.135.63',1,0,'','','Je suis reconnaissant et je me rjouis d\'une vie pleine d\'abondance.','xx',1,0),(36,24,17,1439853574,2,36,'Les matres qui nous gouvernent','Alexandra','alexandra7voyante@gmail.com','91.178.135.63',1,1439884210,'GrCOTE7','','[size=2]On attribue  chaque signe du zodiaque un astre qui est son Matre et qui le gouverne, dans lequel ce dernier se trouve en Domicile Diurne[/size]<br><br>[list]<br>[li][size=2]Mars est le matre du signe du Blier[/size][/li]<br>[li][size=2]Vnus est le matre du signe du Taureau[/size][/li]<br>[li][size=2]Mercure est le matre du signe des Gmeaux[/size][/li]<br>[li][size=2]La lune est le matre du signe Cancer[/size][/li]<br>[li][size=2]Le soleil est le [/size]matre[size=2] du signe Lion[/size][/li]<br>[li][size=2]Mercure est le matre de la Vierge[/size][/li]<br>[li][size=2]Vnus est le matre du signe de la Balan