urs pour ce signe qui conduit l&#39;tre  jouir et  s&#39;panouir pleinement.','xx',1,0),(80,48,19,1441025093,2,81,'Capricorne','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1441095017,'Alexandra','','[size=2]C&#39;est le signe de la montagne, du sommet  atteindre, d&#39;o ambition et lvation sociale lente mais sre.[/size]<br>[size=2]Il reprsente l&#39;avarice, la frugalit, le dpouillement, la vieillesse, la solitude, la ralisation, l&#39;conomie, la patience, la persvrance. [/size]<br>[size=2]Il indique les postes levs, de confiance,  responsabilits. Il montre le devoir, la mthode, l&#39;organisation, l&#39;intgrit, le sang-froid, la prudence, le pessimisme, l&#39;intriorit, le rigoriste, les retards, l&#39;exprience, le dtachement, le recueillement, la sagesse et la frustration.[/size]<br>[size=2]En gnral, il a du sens pratique et il est de bon conseil.[/size]<br>[size=2]C&#39;est le signe de l&#39;administration et aussi de la connaissance.[/size]<br>[size=2]Par analogie avec cette priode de l&#39;anne &nbsp;o la nature lutte contre les&nbsp;rigueurs&nbsp;du froid et du gel, le signe du Capricorne met en place un systme&nbsp;dautodfense, une volont de se suffire  lui mme qui conduisent&nbsp;parfois&nbsp;certains natifs de ce signe  la dfiance,  la&nbsp;misanthropie, au pessimisme, au scepticisme, au refus de tout abandon et de tout laisser-aller, voire  l&#39;indiffrence.[/size]<br>[size=2]Par compensation, la lucidit s&#39;en trouve exalte, ainsi que la logique, la&nbsp;tnacit, l&#39;ambition, le pouvoir de concentration, de rflexion, de maturation, la capacit de se nourrir de l&#39;exprience.&nbsp;[/size]<br>[size=2]Ne comptant que sur lui mme et tant sereinement prpar au pire, le natif&nbsp;du&nbsp;Capricorne possde beaucoup de sang-froid. Il est patient,&nbsp;persvrant, raisonnable et solitaire.[/size]<br><br>','xx',1,0),(81,12,13,1441059228,2,81,'Re: Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','[size=2]Je suis en train de changer ma vie par mes actions,[/size]<br>C&#39;est un choix qui m&#39;appartient.<br>&nbsp;','xx',1,0),(82,49,19,1441102291,2,82,'Verseau','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1441102681,'Alexandra','','C&#39;est le signe du futur.<br>Il est avant gardiste, moderne, humaniste, individualiste, altruiste, indpendant, sympathique et rvolt.<br>Il a des ides et de l&#39;humour. <br>Il symbolise la science, l&#39;avenir, la prospective, l&#39;espace, les communications modernes (tv, cinma, vido, satellite, ordinateur).<br>Il est le signe de l&#39;amiti, de l&#39;invention, de l&#39;originalit, de l&#39;utopie, de l&#39;explosion. <br>Il a un esprit de contradiction.<br>Il reprsente les moyens modernes de transport (train, avions, fuse...) <br>Son esprit non conformiste le pousse )  la rvolte,  la contestation systmatique. <br>Son ouverture d&#39;esprit, son sens inn de la collaboration font des natifs de la fraternit, de la libert, de la politique, de l&#39;excentricit et de la recherche d&#39;une connaissance.<br>','xx',1,0),(84,51,19,1441188216,2,84,'Poissons','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','C&#39;est le signe de l&#39;infini, de ce qui est illimit, de la foi de la mystique.&nbsp;<br>Il apporte des dons artistiques ( musique, danse et comdie ).<br>Il symbolise l&#39;inspiration cratrice, l&#39;imagination, l&#39;image, l&#39;institution et la clairvoyance.&nbsp;<br>Il apporte le sacrifice, le mystre, le secret, la dramatisation, la rverie, le merveilleux, le conte, l&#39;hsitation, la rsignation et la nonchalance.<br>Il peut se montrer faible, paresseux, superstitieux.<br>C&#39;est le domaine de l&#39;image, de l&#39;illusion, de la trahison, la rsignation et la nonchalance.<br>Il peut se montrer faible, paresseux, superstitieux.<br>C&#39;est le domaine de l&#39;image, de l&#39;illusion, de la trahison mais aussi de la douceur, du dvouement et de la gentillesse.<br>Il fuit; il nage entre deux eau