INSERT INTO `smf_user_drafts` VALUES (33,16,7,0,0,1440102262,2,'Re: Pendule ou tout autre objet',0,'[b]Testez-moi gratuitement[/b], envoyez une question, accompagne de votre nom, prnom, date de naissance et rgion. <br>[b][email=alexandra@sublime-voyance.be]alexandra@sublime-voyance.be[/email][/b]<br>Je vous rpondrai maximum dans les 48 heures.<br>Cette offre n&#39;est valable qu&#39;une seule fois!<br><br>Consultation immdiate: [b]0907/37 157[/b] (1,50/min)','xx',0,0,''),(34,5,1,0,0,1440104467,1,'Charte',0,'Introduction:<br><br>Ce forum se veut tre un espace de discussions et d&#39;changes entre passionns. Pour que chacun puisse passer un moment en toute convivialit, voici quelques rgles de bonne conduite  observer<br><br>1- Objet du forum:<br><br>Ce forum regroupe les membres de Sublime-Voyance. Les thmes abords porteront essentiellement sur la parapsychologie sous toutes ses formes. Ce forum a donc pour objectif de faciliter la communication et le partage d&#39;information.<br><br>2- Modalits d&#39;accs au forum:<br>Pour prendre connaissance des messages posts sur notre forum, une inscription est obligatoire<br>En effet, la majeure partie des sujets de ce forum peut tre lue par tous. En revanche, quelques rubriques sont protges et seuls les membres adhrents au Staff peuvent poster des messages.<br><br>3- Les rgles du forum:<br><br>- Politesse et savoir-vivre: respectez les membres, utilisez des formules de politesse, restez calme.<br>- Tous propos diffamatoires, injurieux, insultants, racistes, xnophobes ou obscnes sont interdits sur le forum.<br>- N&#39;abusez pas de l&#39;criture en majuscules. En effet, ces dernires symbolisent un internaute qui CRIE.<br>- [color=red][b]Pour une lecture agrable de ce forum, nous vous incitons  soigner votre orthographe, votre syntaxe et  ne pas utiliser le langage sms.[/b][/color] Nous vous en remercions par avance.<br><br>4- Le rle du modrateur:<br><br>Le rle du modrateur est de faire respecter les rgles de bonne conduite pour rendre les espaces de discussions conviviaux et agrables  tous, en adquation avec les lois du pays (dfinis par le cadre juridique du pays).<br><br>Les missions du modrateur sont : <br><br>- Supprimer des messages ou des discussions ne respectant pas les rgles de bonne conduite.<br>- Supprimer les profils qui nuisent au bon fonctionnement du forum, par exemple via des messages insultants, des messages provocateurs, du proslytisme religieux ou politique, racistes, xnophobes, etc. <br>- Sont concerns galement les utilisateurs qui utilisent simultanment plusieurs profils diffrents sur le mme forum : c&#39;est une attitude que nous assimilons  de la malhonntet envers les autres utilisateurs et donc non admise sur notre forum.<br>- Rpondre  vos alertes ou demandes particulires.<br>- Effacer tout propos interdit sur le site tel que par exemple des propos racistes, diffamatoires, insultants, xnophobes, pdophiles... Que ces propos soient explicites ou implicites, ils seront supprims.<br>- Retirer tout contenu texte, post, photo ou vido illicites<br><br>Le modrateur intervient a posteriori et nintervient pas dans les discussions pour donner son avis, ni lors dun conflit pour donner raison a un internaute. Si un message vous semble contraire aux rgles de bonne conduite nonces ici, signalez-le au modrateur en cliquant sur le bouton &quot;Modrateur&quot; qui figure en bas de page du forum. Vous pourrez lui envoyer un MP .<br><br>Bien  Vous<br><br>Alexandra: Administrateur','xx',0,0,''),(37,0,18,0,0,1440156132,2,'Les signes de Terre',0,'uuu','xx',0,0,''),(39,33,18,0,0,1440158113,2,'Les signes d\'Air',0,'[size=2][size=2][font=Verdana, sans-serif][b]Gmeaux[/b][/font][/size][/size]<br>[size=2][size=2][font=Verdana, sans-serif]Tous les mtiers de la communication et des transports (journaliste,[/font][/size][size=2][font=Verdana, sans-serif]crivain, diteur, facteur, libraire, etc.). Certains sports comme les coureurs&nbsp;[/font][/size][size=2][font=Verdana, sans-serif] pied, les cyclistes, les gymnastes et les tennismen. Les professions du&nbsp;[/font][/size][size=2][font=Verdana, sans-serif]commerce en boutique ou sur les marchs. En mdecine: les spcialistes des poumons ou de la circulation.[/font][/size][/size]<br><br>','xx',0,0,''),(42,33,18,0,0,1440230001,2,'Les signes d\'Air et leur proffessions',0,'[size=2][size=2][font=Verdana, sans-serif][b]Gmeaux[/b][/font][/size][/size]<br>[size=2][size=2][font=Verdana, sans-serif]Tous les mtiers de la communication et des transports (journaliste,[/font][/size][size=2][font=Verdana, sans-serif]crivain, diteur, facteur, libraire, etc.). Certains sports comme les coureurs [/font][/size][size=2][font=Verdana, sans-serif] pied, les cyclistes, les gymnastes et les tennismen. Les professions du [/font][/size][size=2][font=Verdana, sans-serif]commerce en boutique ou sur les marchs. En mdecine: les spcialistes des poumons ou de la circulation.[/font][/size][/size]<br><br>[b]Balance[/b]<br>Tous les mtiers o l&#39;quilibre est important comme ceux de danseur ,[size=2]gymnaste ou quilibriste. Toutes les professions de la justice (avocat, [/size][size=2]juge, etc.) .[/size]<br>Les mtiers de la beaut, de l&#39;esthtique ou de la dcoration. Certaines [size=2]professions artistiques comme peintre ou styliste.[/size]<br>En mdecine: urologue, nphrologue et diabtologue. Et aussi: professeur [size=2]de musique et les mtiers en rapport avec les poids (ascenseur ... ).[/size]<br><br>[b]Verseau[/b]<br>[size=2]Les mtiers lis  la politique et  des organismes internationaux comme [/size][size=2]l&#39;ONU ou !&#39;Unesco. Toutes les professions modernes , nouvelles. Toutes [/size][size=2]les professions lies aux moyens actuels de communication ou de transport [/size][size=2](tlex, informatique, aviation, tlvision, cinma, etc.). [/size][size=2]Et aussi: crivain de science-fiction , astrologue , psychologue, lectronicien, [/size][size=2]publiciste, radiologue. phlbologue, ingnieur, [/size][size=2]magntiseur, parapsycbologue [/size][size=2]et les carrires de l&#39;automobile.[/size]<br>','xx',0,0,''),(46,12,13,0,0,1440246596,2,'Re: Phrase positive',0,'Je cultive le calme.','xx',0,0,''),(47,0,12,0,0,1440246738,2,'Les Astres, les Dieux, les Mythes et les Symboles',0,'Je viens de commencer un nouveau sujet sur&nbsp;Les Astres, les Dieux, les Mythes et les Symboles, j&#39;aimerais que chacun des membres ou nouveau membre<br>[color=#ffffff][size=2][font=Tahoma, sans-serif][iurl=http://&quot;http://forum.sublime-voyance.be/index.php?action=unread;c=9&quot;]Les Astres, les Dieux, les Mythes et les Symboles[/iurl][/font][/size][/color]','xx',0,0,''),(48,0,12,0,0,1440249504,2,'Participation',0,'<br>[size=2]Bonjour, bonsoir, le staff du forum aimerait une participation active de ses membres et nouveau membre au niveau des diffrents sujets proposs, afin, d&#39;avoir une animation et d&#39;obtenir un forum vivant.[/size]<br>[size=2]De faon  ce qu&#39;il ne reste pas dans les oubliettes du web, car un forum non actif napparatra pas sur la premire page des moteurs de recherche grce au rfrencement naturel.[/size]<br><br>[size=2]Alors aidez nous  y parvenir.[/size]<br>','xx',0,0,''),(49,12,13,0,0,1440838119,2,'Re: Phrase positive',0,'Dsormais je savoure chacune de mes actions.','xx',0,0,'');
